import React from "react";
import { Link } from "react-router-dom";
const url = ""
const Navbar = () => {
    return(
        <>
    <section className = "navbar">
    <div className = "nav">
         <Link to = "/"><img src = {url} alt = "Logo" className = "logo" /></Link>

         <ul>
         <li><Link to = "/photogrid" className = "menu lavori"> I nostri lavori </Link></li>
         <li><Link to = "/where" className = "menu dove"> Dove siamo </Link></li>
         </ul>
    </div>
    <div className = "cont">

         <Link to = "/contact"> <h5 className = "disclaimer" > CONTATTACI PER IL TUO MATRIMONIO </h5> </Link>
    </div>
    </section>
    </>
    )
}

export default Navbar;
